        public async Task<JsonResult> GetInquiryListData(int orderBy, string orderDir, string filter, int skip, int top)
        {
            string apiUrl = ConfigurationManager.AppSettings["ServiceApiUrl"].ToString() + "SPInquiry/";

            string orderByField = "";

            switch (orderBy)
            {
                case 5:
                    orderByField = "Inquiry_No " + orderDir;
                    break;
                case 6:
                    orderByField = "Inquiry_Date " + orderDir + ",Inquiry_No " + orderDir;
                    break;
                case 7:
                    orderByField = "Contact_Company_Name " + orderDir;
                    break;
                case 8:
                    orderByField = "Payment_Terms " + orderDir;
                    break;
                case 9:
                    orderByField = "Inquiry_Status " + orderDir;
                    break;
                case 10:
                    orderByField = "Salesperson_Code " + orderDir;
                    break;
            }

            if (Session["SPCodesOfReportingPersonUser"].ToString() == "")
