        public async Task<JsonResult> ExportListData(int orderBy, string orderDir, string filter, int skip, int top)
        {
            string apiUrl = ConfigurationManager.AppSettings["ServiceApiUrl"].ToString() + "SPInquiry/";

            string orderByField = "";

            switch (orderBy)
            {
                case 2:
                    orderByField = "No " + orderDir;
                    break;
                case 3:
                    orderByField = "Sell_to_Customer_Name " + orderDir;
                    break;
                case 4:
                    orderByField = "Sell_to_Contact " + orderDir;
                    break;
                case 5:
                    orderByField = "Posting_Date " + orderDir;
                    break;
                case 6:
                    orderByField = "Due_Date " + orderDir;
                    break;
                case 7:
                    orderByField = "Amount " + orderDir;
                    break;
            }

            apiUrl = apiUrl + "GetAllInquiry?SPCode=" + Session["loggedInUserSPCode"].ToString() + "&skip=" + skip + "&top=" + top + "&orderby=" + orderByField + "&filter=" + filter;

            HttpClient client = new HttpClient();
            List<SPInquiryList> inquiry = new List<SPInquiryList>();

            client.BaseAddress = new Uri(apiUrl);
            client.DefaultRequestHeaders.Accept.Clear();
            client.DefaultRequestHeaders.Accept.Add(new System.Net.Http.Headers.MediaTypeWithQualityHeaderValue("application/json"));

            HttpResponseMessage response = await client.GetAsync(apiUrl);
            if (response.IsSuccessStatusCode)
            {
                var data = await response.Content.ReadAsStringAsync();
                inquiry = Newtonsoft.Json.JsonConvert.DeserializeObject<List<SPInquiryList>>(data);
            }

            DataTable dt = ToDataTable(inquiry);

            string fileName = "InquiryList.xlsx";
            string fullPath = Path.Combine(Server.MapPath("~/temp"), fileName);
            using (XLWorkbook wb = new XLWorkbook())
            {
                wb.Worksheets.Add(dt);

                using (var exportData = new MemoryStream())
                {
                    wb.SaveAs(exportData);
                    FileStream file = new FileStream(fullPath, FileMode.Create, FileAccess.Write);
                    exportData.WriteTo(file);
                    file.Close();
                }
            }

            return Json(new { fileName = fileName, errorMessage = "" }, JsonRequestBehavior.AllowGet);
        }

